    startLine: 77
  assemblies:
  - Argotic.Extensions
  namespace: Argotic.Extensions.Core
  summary: "\nGets or sets the text value that uniquely identifies the endpoint that made the modification.\n"
  remarks: "\n<p>\n    Either or both of the <xref href=\"Argotic.Extensions.Core.FeedSynchronizationHistory.When\" data-throw-if-not-resolved=\"false\"></xref> or <xref href=\"Argotic.Extensions.Core.FeedSynchronizationHistory.By\" data-throw-if-not-resolved=\"false\"></xref> properties <strong>must</strong> be present; it is invalid to have neither.\n    It is <em>recommended</em> that implementers specify both <xref href=\"Argotic.Extensions.Core.FeedSynchronizationHistory.When\" data-throw-if-not-resolved=\"false\"></xref> and <xref href=\"Argotic.Extensions.Core.FeedSynchronizationHistory.By\" data-throw-if-not-resolved=\"false\"></xref> properties whenever possible.\n</p>\n<p>\n    Implementations <strong>should not</strong> assume that the <xref href=\"Argotic.Extensions.Core.FeedSynchronizationHistory.By\" data-throw-if-not-resolved=\"false\"></xref> property will be a human-readable indication of the author of the item;\n    it is simply intended as a unique identifier for use in the synchronization algorithm.\n    The precise entity represented by an endpoint will vary depending on the application.\n</p>\n"
  example: []
  syntax:
    content: public string By { get; set; }
    parameters: []
    return:
      type: System.String
      description: A text value that uniquely identifies the endpoint that made the modification.
    content.vb: Public Property By As String
