  assemblies:
  - Argotic.Extensions
  namespace: Argotic.Extensions.Core
  summary: "\nGets or sets the date-time for the device that performed the item modification.\n"
  remarks: "\n<p>The value for this property <em>should</em> be interpreted as a best effort, uncalibrated value.</p>\n<p>\n    Either or both of the <xref href=\"Argotic.Extensions.Core.FeedSynchronizationHistory.When\" data-throw-if-not-resolved=\"false\"></xref> or <xref href=\"Argotic.Extensions.Core.FeedSynchronizationHistory.By\" data-throw-if-not-resolved=\"false\"></xref> properties <strong>must</strong> be present; it is invalid to have neither.\n    It is <em>recommended</em> that implementers specify both <xref href=\"Argotic.Extensions.Core.FeedSynchronizationHistory.When\" data-throw-if-not-resolved=\"false\"></xref> and <xref href=\"Argotic.Extensions.Core.FeedSynchronizationHistory.By\" data-throw-if-not-resolved=\"false\"></xref> properties whenever possible.\n</p>\n<p>The <xref href=\"System.DateTime\" data-throw-if-not-resolved=\"false\"></xref> value should be provided in Coordinated Universal Time (UTC).</p>\n"
  example: []
  syntax:
    content: public DateTime When { get; set; }
    parameters: []
    return:
      type: System.DateTime
      description: "\nA <xref href=\"System.DateTime\" data-throw-if-not-resolved=\"false\"></xref> that represents the date-time for the device that performed the item modification.\nThe default value is <xref href=\"System.DateTime.MinValue\" data-throw-if-not-resolved=\"false\"></xref>, which indicates that no date-time was specified.\n"
